import React, { useState } from 'react';
import './YourSurveys.css';
// import YourSurveys from '../DataWindowNav/DataWindowNav'
import { getSurveys } from '../../firebaseConfig';
import { useAuth } from '../../contexts/AuthContext'

function YourSurveys(props:any) {
  const { currentUser } = useAuth();
  const surveys:Array<object> = [];

  React.useEffect(() => { //populate with current notification data if any
    getSurveys(currentUser.email).then((collection) => {
      collection.forEach(doc => {
        surveys.push(doc.data())
      })
    }).catch((error) => {
      console.error(error);
    });
  }); //removed dependency array?

  surveys.forEach(survey => survey.timeStamp)

  return (
    <div className="surveys-container">
        surveys
    </div>
  )
};

export default YourSurveys
